import React, { Component } from 'react';


 class List extends Component {

  constructor(props) {
    super(props);

    this.state = {
      resAPI: ""
    };
  }


  componentWillMount() {
    fetch('http://localhost:3000/list')
      .then(res => res.text())
      .then(data => this.setState({ resAPI: data }));
  }

  render() {
    return (
      <div className="contact">
        <h1>Liste</h1>
        <button onClick={(e)=>{
            e.preventDefault
            var list = this.state.resAPI
            var lister = JSON.parse(list)
            //console.log(JSON.parse(list))
          for(var i=0;i<list.length;i++)
          {
            document.getElementById("nom").innerHTML += lister[i].nom+ "<br>";
            document.getElementById("prenom").innerHTML += lister[i].prenom+ "<br>";
          }
        }}>
            My List
        </button>
        <p id="nom"></p>
        <p id="prenom"></p>
      </div>
    )
  }
}

export default List;
